function $paises() {
  let paises = [];
  for (const pais in $regiones) {
    paises.push({
      pais,
      bandera: $regiones[pais].flagSVG_4x3,
    });
  }
  paises.sort();
  return paises;
}

function $optionPaises() {
  let html = "";
  let paises = [];
  for (const pais in $regiones) {
    paises.push({
      pais,
      bandera: $regiones[pais].flagSVG_4x3,
    });
  }
  paises.sort();
  let first = true;
  for (const pais of paises) {
    html += `
    <option value="${pais.pais}" ${first ? "selected='selected'" : ""}>
      ${pais.pais}
    </option>
    `;
    first = false;
  }
  return html;
}

function $estados(pais) {
  let estados = [];
  for (const estado in $regiones[pais].estados) {
    estados.push(estado);
  }
  estados.sort();
  return estados;
}

function $optionEstados(pais) {
  let estados = [];
  for (const estado in $regiones[pais].estados) {
    estados.push(estado);
  }
  estados.sort();
  let first = true;
  let html = "";
  for (const estado of estados) {
    html += `<option value="${estado}" ${
      first ? "selected='selected'" : ""
    }>${estado}</option>`;
    first = false;
  }
  return html;
}

function $ciudades(pais, estado) {
  let ciudades = []
  for (const e in $regiones[pais]?.estados[estado]?.ciudades) {
    ciudades.push(e)
  }
  ciudades.sort()
  return ciudades
}

function $optionCiudades(pais, estado) {
  let ciudades = []
  for (const e in $regiones[pais]?.estados[estado]?.ciudades) {
    ciudades.push(e)
  }
  ciudades.sort()
  let first = true
  let html = ""
  for (const ciudad of ciudades) {
    html += `<option value="${ciudad}" ${first ? "selected='selected'" : ""}>${ciudad}</option>`
    first = false
  }
  return html
}

